import React from "react";
import {
  Route,
  BrowserRouter as Router,
  Switch,
  BrowserRouter,
} from "react-router-dom";
import "./App.css";

import Header from "./components/Header/Header";
import FooterWrapper from "./components/footer/Footer";
import Banner from "./components/Banner/banner";
import Home from "./components/Home/Home";
import Sorting from "./components/sorting/sorting";
import Search from "./components/Search/serch";
import serchimage from "./components/images/serch.svg";
import Mywishlist from "./components/wishlist/mywishlist";
import User from "./components/User/UserProfile";
const App: React.FC = () => {
  return (
    <BrowserRouter>
      <div>
        <Switch>
        <Route path="/">
            <Header />
              <Home />
          </Route>
          <Route path="/User">
            <Header />
              <User />

          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
};

export default App;
